import logo from '../assets/logo.png';
import React, { useEffect, useState } from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Avatar from '@mui/material/Avatar';
import '../pages/styles/Home.css';

function Home() {
  return (
    <div>
      {/* Navigation */}
      <header className='navbar'>
        <Avatar
          alt='Fitness logo'
          src={logo}
          sx={{ width: 80, height: 80, margin: '0-auto' }}
        />
        <div className='logo'>Fitness Nation</div>
        <nav>
          <a href='#home' className='nav-link'>
            Home
          </a>
          <a href='#about' className='nav-link'>
            About
          </a>
          <a href='#contact' className='nav-link'>
            Contact
          </a>
        </nav>
      </header>

      {/* Hero Section */}
      <section className='hero-section'>
        <div className='hero-content'>
          <h1 className='hero-title'>Unleash Your Potential</h1>
          <p className='hero-subtitle'>
            Join the fitness revolution. Personalized workouts and expert
            coaching await you.
          </p>
          <div className='button-container'>
            <button className='primary-button'>Join Now</button>
            <button className='secondary-button'>Learn More</button>
          </div>
        </div>
      </section>

      {/* Footer */}
      <footer className='footer'>
        <p>Â© 2025 Fitness Nation. All rights reserved.</p>
      </footer>
    </div>
  );
}

export default Home;
